import React from "react";
import ParticleEffect from "./ParticleEffect";

function About() {
  return (
    <section
      id="about"
      className="relative min-h-screen flex flex-col justify-center items-center text-center px-6 overflow-hidden"
      style={{
        background: "linear-gradient(to bottom, rgba(99, 102, 241, 0.1), rgba(14, 165, 233, 0.1))",
      }}
    >
      {/* Particle Effect */}
      ,
      <ParticleEffect />

      {/* Content */}
      <div className="relative z-10">
        <h2 className="text-3xl font-bold text-white">About Me</h2>
        <p className="text-lg text-gray-300 mt-4 max-w-2xl">
          With expertise in frontend development, UI/UX design, and backend engineering, I specialize in creating high-performance web applications.
        </p>
      </div>
    </section>
  );
}

export default About;
